import React, { Component } from 'react'
import PropTypes from 'prop-types'
import style from './SlideNumbers.module.scss'

export default class SlideNumbers extends Component {
  static propTypes = {
    prop: PropTypes
  }

  render() {
    return (
      <div className={style.SlideNumbers}>
        SlideNumbers
      </div>
    )
  }
}
